    country_dict = access_dict.get(country_iso3)
    highway_level = get_level(highway)

    if country_dict is not None:
        highway_access = country_dict['highway'].get(highway)
        if highway_access is not None:
            if highway_access[access_type] != 'no':
                return True
            else:
                return False

        highway_access = country_dict['level'].get(highway_level)
        if highway_access is not None:
            if highway_access[access_type] != 'no':
                return True
            else:
                return False

    country = 'default'
